import React from 'react';

import gmail from '../assets/images/gmail.png'
import linkedin from '../assets/images/linkedin.png'
import github from '../assets/images/github.png'

const styles = {
    footer: {
        position: 'fixed',
        left: '0',
        bottom: '0',
        width: '100%',
        backgroundColor: 'lightblue',
    }
};

function Footer() {

    return (
        <footer style={styles.footer} className='d-flex justify-content-center align-items-center'>
            <a href="mailto:joey.douek@gmail.com">

      </a> 
      <a href="https://github.com/joeyblue27">

      </a>
      <a href="https://www.linkedin.com/in/joey-douek-279908273">

      </a>
        </footer>
    );
};

export default Footer;
